import React from 'react';
import LogoFlylist from '../../assets/svg/logo-flylist.svg'
import LogoTchat from '../../assets/svg/logo-tchat.svg'
import LogoAeroaja from '../../assets/svg/logo-aeroaja.svg'
import LogoAsita from '../../assets/svg/logo-asitaaja.svg'

export default class Products extends React.Component {
  render() {
    return(
      <div style={{backgroundColor:'#259eb9'}}>
        <div className="white f25" style={{paddingTop: 50, marginBottom:40, textAlign: 'center', fontFamily: 'Arvo-Regular', fontWeight: 300}}><b>Our Product</b></div>
        <div className="row" style={{margin: 10}}> 
          <div style={{marginLeft:20}}><img src={LogoFlylist} alt="logoflylist" style={{width:'50%'}}/></div>
          <div><img src={LogoTchat} alt="logotchat" style={{width:'50%'}}/></div>
          <div><img src={LogoAeroaja} alt="logoaeroaja" style={{width:'50%'}}/></div>
          <div><img src={LogoAsita} alt="logoasitaaja" style={{width:'50%'}}/></div>
        </div>
      </div>
    )
  }
}
